::: {.callout-note collapse="false"}
#### New Packages!

These are the main packages we're going to use in this block. It might
make sense to install them now *if you do not have them already*

-   **tidyverse** : for organising data\
-   **lme4** : for fitting generalised linear mixed effects models
-   **broom.mixed** : tidying methods for mixed models
-   **effects** : for tabulating and graphing effects in linear models
-   **lmerTest**: for quick p-values from mixed models
-   **parameters**: various inferential methods for mixed models
:::

# Getting to grips with MLM

::: lo
These exercises are not "how to do analyses with multilevel models" -
they are designed to get you thinking, and help with an understanding of
how these models work.
:::

::::::: frame
**Data: New Toys!**

Let's consider a linear regression scenario with a toy dataset. Analysis
question: How does practice influences the reading age of toy characters
Dataset link: <https://uoepsy.github.io/data/toy2.csv> contains
information on 129 different toy characters that come from a selection
of different families/types of toy.

You can see the variables in the table below[^1].\
