Below is some code that fits a model of "reading age" (`R_AGE`)
predicted by hours of practice (`hrs_week`). Line 2 then gets the
'fitted' values from the model and adds them as a new column to the
dataset, called `pred_lm`. The fitted values are what the model predicts
for every individual observation (every individual toy in our dataset).

Lines 4-7 then plot the data, split up by each type of toy, and adds
lines showing the model fitted values.

Run the code and check that you get a plot. What do you notice about the
lines?

**One thing I notice about the lines is they all appear to have the same
slope (though the length of the lines differ) and that we are not
representing the data well at all with this model**



::: {.cell}

```{.r .cell-code  code-line-numbers="true"}
lm_mod <- lm(R_AGE ~ hrs_week, data = toy2)
toy2$pred_lm <- predict(lm_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_lm), col = "red")
```
:::



We should get something like this:



::: {.cell}

```{.r .cell-code}
lm_mod <- lm(R_AGE ~ hrs_week, data = toy2)
toy2$pred_lm <- predict(lm_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_lm), col = "red")
```

::: {.cell-output-display}
![](MLM_Intro_Questions_files/figure-html/unnamed-chunk-5-1.png){width=672}
:::
:::



Note that the lines are exactly the same for each type of toy. This
makes total sense, because the model (which is where we've got the lines
from) completely *ignores* the `toy_type` variable!

Below are 3 more code chunks that all 1) fit a model, then 2) add the
fitted values of that model to the plot.

The first model is a 'no-pooling' approach, where we use tools learned
in USMR and simply add in `toy_type` as a predictor in the model to
estimate all the differences between types of toys.

The second and third are multilevel models. The second fits random
intercepts by-toytype, and the third fits random intercepts and slopes
of `hrs_week`

Copy each chunk and run through the code. Pay attention to how the lines
differ.

**Okay something I notice in the first chunk here below is that the
slope still appears to be the same but now we've moved up along the
y-axis and actually meeting the observed values in the 2 dimensional
space, but still not a good model. The second chunk of code produces the
exact same results we saw in the first chunk, which is interesting.
Finally the third model fits the data way better, the slope actually
varies by toy and the line of best fit meets all the observed values.
This third model is the best so far.**



::: {.cell}

```{.r .cell-code  code-fold="true"}
fe_mod <- lm(R_AGE ~ toy_type + hrs_week, data = toy2)
toy2$pred_fe <- predict(fe_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_fe), col = "blue")
```
:::

::: {.cell}

```{.r .cell-code  code-fold="true"}
library(lme4)
ri_mod <- lmer(R_AGE ~ hrs_week + (1 | toy_type), data = toy2)
toy2$pred_ri <- predict(ri_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_ri), col = "green")
```
:::

::: {.cell}

```{.r .cell-code  code-fold="true"}
rs_mod <- lmer(R_AGE ~ hrs_week + (1 + hrs_week | toy_type), data = toy2)
toy2$pred_rs <- predict(rs_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_rs), col = "orange")
```
:::

