The first model has an adjustment for each toy-type (we can see this in
the coefficients if we want). What this means is that the line for each
type of toy is shifted up or down. We can see that the lines are now
shifted up for things like "Scooby Doo" and "G.I.Joe", and down for
"transformers" and "farm animals":



::: {.cell}

```{.r .cell-code}
fe_mod <- lm(R_AGE ~ toy_type + hrs_week, data = toy2)
toy2$pred_fe <- predict(fe_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_fe), col = "blue")
```

::: {.cell-output-display}
![](MLM_Intro_Questions_files/figure-html/unnamed-chunk-10-1.png){width=672}
:::
:::



This next one *looks* very similar to the previous one, but it is
conceptually doing something a bit different. Rather than separating out
and estimating differences between all the toy-types, we are modelling
*a distribution* of deviations for each type from some average.



::: {.cell}

```{.r .cell-code}
ri_mod <- lmer(R_AGE ~ hrs_week + (1 | toy_type), data = toy2)
toy2$pred_ri <- predict(ri_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_ri), col = "green")
```

::: {.cell-output-display}
![](MLM_Intro_Questions_files/figure-html/unnamed-chunk-11-1.png){width=672}
:::
:::



Finally, we can add in the random slopes of `hrs_week`. In this model,
we are not only allowing toy-types to vary in their average reading age
(i.e. shifting lines up and down), but we are also allowing them to vary
in the association between hrs_week and reading age (letting the lines
have different slopes). Some types of toy (Scooby Doo, Sock Puppets,
Stretch Armstrong) have fairly positive slopes, and some have a flatter
association (e.g, SuperZings etc).



::: {.cell}

```{.r .cell-code}
rs_mod <- lmer(R_AGE ~ hrs_week + (1 + hrs_week | toy_type), data = toy2)
toy2$pred_rs <- predict(rs_mod)

ggplot(toy2, aes(x = hrs_week)) + 
  geom_point(aes(y = R_AGE), size=1, alpha=.3) +
  facet_wrap(~toy_type) +
  geom_line(aes(y=pred_rs), col = "orange")
```

::: {.cell-output-display}
![](MLM_Intro_Questions_files/figure-html/unnamed-chunk-12-1.png){width=672}
:::
