# Audio Interference in Executive Functioning (Repeated Measures)

::: lo
This next set are closer to conducting a real study. We have some data
and a research question (below). The exercises will walk you through
describing the data, then prompt you to think about how we might fit an
appropriate model to address the research question, and finally task you
with having a go at writing up what you've done.
:::







::: frame
**Data: Audio interference in executive functioning**

This data is from a simulated study that aims to investigate the
following research question:

> How do different types of audio interfere with executive functioning,
> and does this interference differ depending upon whether or not
> noise-cancelling headphones are used?

30 healthy volunteers each completed the
Symbol Digit Modalities Test (SDMT) - a commonly used test to assess
processing speed and motor speed - a total of 15 times. During the
tests, participants listened to either no audio (5 tests), white noise
(5 tests) or classical music (5 tests). Half the participants listened
via active-noise-cancelling headphones, and the other half listened via
speakers in the room. Unfortunately, lots of the tests were not
administered correctly, and so not every participant has the full 15
trials worth of data.

The data is available at
<https://uoepsy.github.io/data/lmm_ef_sdmt.csv>.



