> How do different types of audio interfere with executive functioning,
> and does this interference differ depending upon whether or not
> noise-cancelling headphones are used?

Consider the following questions about the study:

-   What is our outcome of interest?

-   **The outcome of interest would be SDMT scores**\

-   What variables are we seeking to investigate in terms of their
    impact on the outcome?\
    **We interested in how audio variables (no music, white noise,
    music) affect SDMT scores (with an interaction for headphones)**

-   What are the units of observations?\
    **I was looking for units of measurement like decibels or \# correct
    on SDMT but the answer seems to be individual trials**

-   Are the observations clustered/grouped? In what way?

-   **Observations are grouped by individual (so that would be something
    like a random effect) and also the music conditions are clustered
    around use of noise canceling headphones or not**\

-   What varies *within* these clusters?\
    **See above, audio source**

-   What varies *between* these clusters?

-   **Use of headphones or not**

-   What is our outcome of interest?

    -   **SDMT scores**\

-   What variables are we seeking to investigate in terms of their
    impact on the outcome?

    -   **audio type** and the interaction **audio type** $\times$
        wearing headphones

-   What are the units of observations?

    -   **individual trials**\

-   What are the groups/clusters?

    -   **participants**\

-   What varies *within* these clusters?

    -   **the type of audio**\

-   What varies *between* these clusters?

    -   **whether they listen via headphones or speakers**



