> How do different types of audio interfere with executive functioning,
> and does this interference differ depending upon whether or not
> noise-cancelling headphones are used?

Specifying the model may feel like a lot, but try splitting it into
three parts:

$$
\text{lmer(}\overbrace{\text{outcome }\sim\text{ fixed effects}}^1\, + \, (1 + \underbrace{\text{slopes}}_3\, |\, \overbrace{\text{grouping structure}}^2 )
$$

1.  Just like the `lm()`s we have used in the past, think about what we
    want to *test*. This should provide the outcome and the structure of
    our fixed effects.\
2.  Think about how the observations are clustered/grouped. This should
    tell us how to specify the grouping structure in the random
    effects.\
3.  Think about which slopes (i.e. which terms in our fixed effects)
    could feasibly vary between the clusters. This provides you with
    what to put in as random slopes.



::: {.cell}

```{.r .cell-code}
# here is my attempt

lmer(SDMT ~ audio*headphones + (1 | PID), data = efdat)
```

