#### Hints

Make sure to read about multilevel modesl and how to fit them in
[Chapter 2: MLM
#multilevel-models-in-r](https://uoepsy.github.io/lmm/02_lmm.html#multilevel-models-in-r){target="_blank"}.
:::

The question\
    "*How do different types of audio interfere with executive
functioning*" means we are interested in the effects of audio type
(`audio`) on executive functioning (`SDMT` scores), so we will want:

```         
lmer(SDMT ~ audio ...
```

However, the research aim also asks\
    "*... and does this interference differ depending upon whether or
not noise-cancelling headphones are used?*"\
which suggests that we are interested in the interaction
`SDMT ~ audio * headphones`

```         
lmer(SDMT ~ audio * headphones + ...   
```

There are lots of ways that our data is grouped.\
We have:

-   3 different groups of audio type
    (no_audio, white_noise, music)
-   2 groups of listening condition
    (S, H)
-   30 groups of participants ("PPT_01", "PPT_02", "PPT_03", ...)

The effects of audio type and headphones are both things we actually
want to *test* - these variables are in our fixed effects. The levels of
audio and headphones are not just a random sample from a wider
population of levels - they're a specific set of things we want to
compare SDMT scores between.

Compare this with the participants - we don't care about if there is a
difference in SDMT scores between e.g., "PPT_03" and "PPT_28". The
participants themselves are just a sample of people that we have taken
from a wider population. This makes thinking of "by-participant random
effects" a sensible approach - we model differences between participants
as a normal distribution of deviations around some average:

```         
lmer(SDMT ~ audio * headphones + (1 + ... | PID)  
```

The minimum that we can include is the random intercept. What `(1|PID)`
specifies is that "participants vary in their SDMT scores". This makes
sense - we would expect some participants to have higher executive
functioning (and so will tend to score high on the SDMT), and others to
have lower functioning (and so tend to score lower).

We can also include a random by-participant effect of `audio`.\
`audio|PID` specifies that the effect of audio type on SDMT varies by
participant. This seems feasible - music might be very distracting (and
interfere a lot with the test) for some participants, but have a
negligible effect for others.

```         
lmer(SDMT ~ audio * headphones + 
              (1 + audio | PID), data = efdat)
```

::: {.callout-tip collapse="true"}
#### Why can't we have `(headphones|PID)`?

Why can we fit `(1 + audio | PID)` but not `(1 + headphones | PID)`, or
both `(1 + audio + headphones | PID)` or
`(1 + audio * headphones | PID)`?

Remember that `y ~ ... + (x | g)` is saying "the slope of y\~x varies by
g".\
Such a sentence only makes sense if each "the slope of y\~x" is defined
for every (or most) groups.

For the `headphones` predictor, every participant is *either* in the "S"
(speakers) condition *or* the "H" (headphones) condition.\
This means that "the effect of headphones on SDMT" *doesn't exist* for
any single participant! This means it makes no sense to try and think of
the effect as 'varying by participant'.

Compare this to the `audio` predictor, for the effect *does* exist for a
single given participant, therefore it is possible to think of it as
being different for different participants (e.g. PPT_30's performance
improves with white noise, but PPT_16's performance does not).

The plots below may help to cement this idea:



