intervals or anything - i.e. we have no inferential criteria on which to
draw conclusions. There are a whole load of different methods available
for drawing inferences from multilevel models, which means it can be a
bit of a never-ending rabbit hole. For now, we'll just use the 'quick
and easy' approach provided by the **lmerTest** package seen in the
lectures.

