#### Hints

If you use `library(lmerTest)` to load the package, then *every single*
model you fit will show p-values calculated with the Satterthwaite
method.\
Personally, I would rather this is not the case, so I often opt to fit
specific models with these p-values without ever loading the package:\
`modp <- lmerTest::lmer(y ~ 1 + x + ....`
:::

::: {.callout-caution collapse="true"}
#### optional: a model comparison

If we want to go down the model comparison route, we just need to
isolate the relevant part(s) of the model that we are interested in.

Remember, model comparison is sometimes a useful way of testing a *set*
of coefficients. For instance, in this example the interaction involves
estimating *two* terms: `audiomusic:headphonesH` and
`audiowhite_noise:headphonesH`.

To test the interaction as a whole, we can create a model without the
interaction, and then compare it. The `SATmodcomp()` function from the
**pbkrtest** package provides a way of conducting an F test with the
same Satterthwaite method of approximating the degrees of freedom:



::: {.cell}

```{.r .cell-code}
sdmt_mod <- lmer(SDMT ~ audio * headphones + 
              (1 + audio | PID), data = efdat)
sdmt_res <- lmer(SDMT ~ audio + headphones + 
                   (1 + audio | PID), data = efdat)
library(pbkrtest)
SATmodcomp(largeModel = sdmt_mod, smallModel = sdmt_res)
```

