We've already seen in the example with the with the different types of
toys (above) that we can visualise the fitted values (model
predictions). But these were plotting all the cluster-specific values,
and what we are really interested in are the estimates of (and
uncertainty around) our *fixed effects* (i.e. estimates for clusters *on
average*)

Using tools like the **effects** package can provide us with the values
of the outcome across levels of a specific fixed predictor (holding
other predictors at their mean).

This should get you started:



::: {.cell}

```{.r .cell-code}
library(effects)
effect(term = "audio*headphones", mod = sdmt_mod) |>
  as.data.frame()
```
:::



::: {.callout-tip collapse="true"}
#### Hints

You can see the effects package in [Chapter 2: MLM
#visualising-models](https://uoepsy.github.io/lmm/02_lmm.html#visualising-models){target="_blank"}.
The logic is just the same as it was for USMR, it's just that the
estimated effects are from an `lmer()` instead of an `lm()`/`glm()`.
:::



::: {.cell}

```{.r .cell-code}
library(effects)
effect(term = "audio*headphones", mod = sdmt_mod) |>
  as.data.frame() |>
  ggplot(aes(x=audio,y=fit,
             ymin=lower,ymax=upper,
             col=headphones))+
  geom_pointrange(size=1,lwd=1)
```

