#We were interested in the effects of audio and headphone usage on SDMT. To test these effects, we used a linear mixed effects model (where fixed effects were audio type (no audio/white noise/music) whereby we were interested in the interaction between audio type and the source (headphones/speakers). The random effects were the participants.

