::: int
SDMT scores were modelled using linear mixed effects regression, with
fixed effects of audio-type (no audio/white noise/music, treatment coded
with no audio as the reference level), audio delivery (speakers vs
ANC-headphones, treatment coded with speakers as the reference level)
and their interaction. Participant-level random intercepts and random
slopes of audio-type were also included. The inclusion of the
interaction term between audio-type and audio-delivery was used to
address the question of whether the interference of different audio on
executive function depends on whether it is heard via noise-cancelling
headphones. A model comparison was conducted between the full model and
a restricted model that was identical to the full model with the
exception that the interaction term was excluded. Models were fitted
using the **lme4** package in R, and estimated with restricted
estimation maximum likelihood (REML). Denominator degrees of freedom for
all comparisons and tests were approximated using the Satterthwaite
method.

Inclusion of the interaction between headphones and audio-type was found
to improve model fit ($F(2, 26.9) = 11.05, p < .001$), suggesting that
the interference of different types of audio on executive functioning is
dependent upon whether the audio is presented through ANC-headphones or
through speakers.

Participants not wearing headphones and presented with no audio scored
on average 33.26 on the SDMT. For participants without
headphones, listening to music via speakers was associated with lower
scores compared to no audio
($b = -8.02, t(27.59)=-5.68, p <0.001$), but
there was no significant difference between white noise and no audio.

With no audio playing, wearing ANC-headphones was associated with higher
SDMT scores compared to those wearing no headphones
($b = 6.85, t(28.19)=2.44, p =0.021$). The
apparent detrimental effect of music on SDMT scores was not
significantly different in the headphones condition compared to the
no-headphones condition
($b = -3.59, t(27.94)=-1.79, p =0.084$).
Compared to those listening through speakers, white noise was associated
with a greater increase in scores over no audio, when listening via
ANC-heaphones
($b = 8.02, t(26.46)=3.92, p <0.001$).

There was considerable variability in baseline (i.e. no-audio) SDMT
scores across participants (SD = 7.15), with participants
showing similar variability in the effects of music (SD = 3.7)
and of white-noise (SD = 3.9). A weak negative correlation
(-0.25) between participant-level intercepts and effects of
white-noise indicated that people who score higher in the no-audio
condition tended to be more negatively effect by white-noise. A similar
weak negative correlation (-0.16) between music and white-noise
effects suggests participants who were more positively affected by one
type of audio tended to be more negatively affected by the other.

These results suggest that music appears to interfere with executive
functioning (lower SDMT scores) compared to listening to no audio, and
this is not dependent upon whether is heard through headphones or
speakers. When listening via speakers, white noise was not associated
with differences in executive functioning compared to no audio, but this
was different for those listening via headphones, in which white noise
saw a greater increase in performance. Furthermore, there appear to be
benefits for executive functioning from wearing ANC-headphones even when
not-listening to audio, perhaps due to the noise cancellation. The
pattern of findings are displayed in @fig-efplot.



